B.b5U=new A.j("Default background color in M2 mode comes from Material of type card, which by default is set to theme colorScheme surface. When using Material 3, Card also gets elevation based tint using the scheme surfaceTint color. When using Material 2, surfaceTint has no effect even if specified.\n\nYou can set Card theme or widget property surfaceTintColor to Colors.transparent to remove the elevation tint. In FlexColorScheme Component Theme settings you can remove all elevation tint from all widgets on desired platforms.\n\nCards still have elevation shadow in M3 mode as before. You an remove the shadow from elevated cards in M3 mode, to make only elevation tinted cards by assigning Colors.transparent to its shadowColor theme or widget property.\n",null,null,null,null,null,null,null,null,null,null)
