B.b6l=new A.j("Surface blend uses alpha blend, to mix in the surface tint color into surfaces and backgrounds. The blend level is the used alpha value in an alpha blend. The mode changes used factor of this alpha blend value differently for different surface colors, like surface, background, scaffold background and dialog background colors.\n\nBlends also applies to surfaces when M3 seeded ColorSchemes are used. Seed based M3 surfaces already include a touch of primary color, you can make it stronger with surface blends. To use default M3 surface color results, use blend level zero.\n\nWhen using a surface blend mode with a high factor on Scaffold background, the design intent is to not place any controls or text on it directly, but to always use them on other surfaces with less surface tint, for example in Cards. The Scaffold background is then only used as a background color effect. If your app places controls directly on Scaffold, a high blend factor on Scaffold background color may not be a good fit. Choose one where it has a lower color blend factor.",null,null,null,null,null,null,null,null,null,null)
