B.bax=new A.d9("Introduction",B.Gz,0,null,"Use Themes Playground to try features and themes of FlexColorScheme. Find a theme you like, experiment with surface blends and try Material 3\n")
B.aEP=new A.a1(61359,"MaterialIcons",!1)
B.bav=new A.d9("Premade designs",B.aEP,0,"Premade\ndesigns",'To quick start your theming try these premade designs. You can use them as starting points, for inspiration and to see examples of what FlexColorScheme can do. These templates do no set colors, you choose them as desired. Many choices use seeded Material 3 ColorScheme and they all use Material 3 mode. You can easily turn both off. In fact all configs are just starting points for you to explore and modify further.\n\nIn a two panels view, try the Theme simulator as 2nd panel with the official Material 3 demo app, using 11" or 12" iPad, to experience how these examples impact the design of the app and components.\n')
B.baj=new A.d9("Theme simulator",B.dN,0,"Theme\nsimulator","Use the theme simulator and its devices in a side view as you change theme settings, and see how the changes modify the look and feel of included demo apps.\n")
B.GA=new A.a1(61747,"MaterialIcons",!1)
B.bah=new A.d9("Theme code",B.GA,0,"Theme\ncode","This is the setup code for the light and dark theme you have configured. It changes as you adjust theme settings in the Playground.\n\nUse this view as a side panel to see and learn what API properties each setting modifies.\n\nFlexColorScheme works like an advanced ThemeData factory. It returns a very elaborate Flutter ThemeData object, with a lot less setup needed. Some of its possible configurations would require over 2000 rows of code to reproduce with the vanilla ThemeData factory.\n")
B.GI=new A.a1(62663,"MaterialIcons",!1)
B.bap=new A.d9("Component themes",B.GI,0,"Component\nthemes","FlexColorScheme's Material 2 mode component themes are very opinionated. Components look almost like Material 3 mode components, but done in Material 2 mode.\n\nWhen using Material 3, there are only a few nuance differences compared to default M3 styles, plus some minor fixes to a few Flutter Material 3 specification deviations.\n")
B.baG=new A.d9("Theme colors",B.aR,0,"Theme\ncolors","Theme colors show the color values defined for the selected color scheme. You can use any predefined scheme as a starting point for your own custom colors.\n")
B.aEM=new A.a1(61292,"MaterialIcons",!1)
B.baB=new A.d9("Seeded ColorScheme",B.aEM,0,"Seeded\nColorScheme","In Material 3 color system, seed generated light and dark mode ColorSchemes use the same key colors to generate six tonal palettes. Light and dark ColorScheme colors, use the same palettes, but different tones. This ensures that light and dark modes are color matched with each other.\n\nTo ensure that light and dark themes use identical tonal palettes, FlexColorScheme uses the light mode colors from built-in schemes, to seed generate the ColorSchemes. When using custom colors, you can decide if you do so or not.\n")
B.GB=new A.a1(61751,"MaterialIcons",!1)
B.bau=new A.d9("Surface blends",B.GB,0,"Surface\nblends","Material 2 design demonstrated using surfaces with primary color alpha blends in dark mode. FlexColorScheme surface blends provides this for both light and dark mode. Material 3 design has a new color system where a hint of primary color is also used on surfaces. It is done via its neutral tonal palettes, that are shifted slightly towards the primary color.\n\nWhen using M3 seeded ColorSchemes, set blend level to zero to get the pure M3 design. With surface blends, you can further strengthen the M3 effect. You can vary blend levels by surface type in both M2 and M3 mode, regardless of if you used seeded ColorScheme or not.\n\nSurface blend settings have separate control values in the Playground for light and dark mode. Different values for blends in light and dark mode are often a part of the desired design.\n")
B.aEY=new A.a1(61645,"MaterialIcons",!1)
B.bak=new A.d9("Effective colors",B.aEY,0,"Effective\ncolors","The effective colors show the current effective colors in the theme's ColorScheme, colors directly in ThemeData and also important component theme colors. It also provides some additional useful background information about colors in Flutter, that are useful to be aware of.")
B.aFg=new A.a1(62122,"MaterialIcons",!1)
B.baF=new A.d9("TextField",B.aFg,0,null,"Text fields allow users to enter text into a UI. They typically appear in forms and dialogs. TextField theming is done via the InputDecorator theme, it is a fairly complex theme with mixed legacy and MaterialState properties.\n")
B.GH=new A.a1(62656,"MaterialIcons",!1)
B.baw=new A.d9("AppBar and BottomAppBar",B.GH,0,"AppBar","Top app bars display information and actions at the top of a screen. Material 2 uses primary colored AppBar in light mode and almost black in dark mode. Material 3 defaults to surface color in both light and dark theme mode. With FCS you can use select if you want Primary, Material2 surface, background, scaffoldBackground colors with their surfaceTint and blends, or use a custom color.\n\nA bottom app bar displays navigation and key actions at the bottom of mobile screens.\n")
B.aFs=new A.a1(62491,"MaterialIcons",!1)
B.bam=new A.d9("TabBar",B.aFs,0,null,"Tabs organize content across different screens, data sets, and other interactions.\n\nFlexColorscheme comes with a quick TabBar styling option, where you can choose if it should always fit in your AppBar, regardless of what theme you set for the AppBar. Usually you want this, but sometimes surface might be preferred or the Flutter SDK default style. In M2 mode Flutter default does not work well on surface colored AppBar, and in M3 mode the default does not work with primary colored AppBar. By using the FCS forAppBar style, the TabBar always fits with selected AppBar theme.\n")
B.aEq=new A.a1(59044,"MaterialIcons",!1)
B.baq=new A.d9("BottomNavigationBar",B.aEq,0,"Bottom\nNavigationBar","Navigation bars offer a persistent and convenient way to switch between primary destinations in an app. The BottomNavigationBar is used for top level destination navigation on phones in Material 2 design. In Material 3 it has been replaced with NavigationBar, prefer using it instead.\n\nDefault SDK background color is theme canvasColor via Material. The canvasColor is typically colorScheme.background, elevation is 8. FCS sub-theme default is colorScheme.background and elevation 0.\n")
B.aDE=new A.a1(57646,"MaterialIcons",!1)
B.bas=new A.d9("NavigationBar",B.aDE,0,"Navigation\nBar","Navigation bars offer a persistent and convenient way to switch between primary destinations in an app. The NavigationBar is used for top level destination navigation on phones in Material 3 design.\n\nDefault background color is surface with an onSurface overlay color in M2. In M3 default background color is surface with elevation 3, using M3 elevation tint. FlexColorScheme M2 theme default is color scheme background, with active surface blend and elevation 0. FCS M3 mode background is same as M3 default.\n")
B.aFD=new A.a1(983693,"MaterialIcons",!1)
B.baf=new A.d9("NavigationRail",B.aFD,2,"Navigation\nRail","The NavigationRail is typically used for top level destination navigation on tablets and sometimes also on desktops. It supports both Material 2 and 3, styles rails. Flutter default background color is colorScheme.surface. FlexColorScheme sub-theme default is colorScheme.background.\n")
B.aEU=new A.a1(61517,"MaterialIcons",!0)
B.baA=new A.d9("NavigationDrawer",B.aEU,0,"Navigation\nDrawer","A drawer is used on phones to provide navigation destinations in a hidden side drawer. On desktop media sizes, a navigation drawer can also be used as pinned side menu.\n\nFlutter default background is colorScheme.background for Drawer in M2 mode, but colorScheme.surface in M3. FlexColorScheme component sub-themes use surface as default color in both modes.\n")
B.aEN=new A.a1(61330,"MaterialIcons",!1)
B.bad=new A.d9("Material buttons",B.aEN,0,"Material\nbuttons","Buttons help people take action, such as sending an email, sharing a document, or liking a comment.\n\nIn Flutter Material buttons refer to the standard push buttons, implemented using ButtonStyleButton. The buttons are ElevatedButton, FilledButton, FilledButton.tonal, OutlinedButton and TextButton. They are quite versatile when it comes to their theming capabilities. With all the styles offered, they often also work well as they are.\n")
B.aFx=new A.a1(62621,"MaterialIcons",!1)
B.bao=new A.d9("Segmented buttons",B.aFx,0,"Segmented\nbuttons","Segmented buttons help people select options, switch views, or sort elements. In Flutter segmented buttons includes both the Material 2 style ToggleButtons and Material 3 style SegmentedButton.\n\nFlexColorsScheme uses a sophisticated theme to modernize ToggleButtons. For some use cases, like when using only icons, it may still fit and work better than the new M3 SegmentedButton. ToggleButtons sizes itself to fit each item, you have to size the content equally if that is desired. SegmentedButton makes all segments same size by default, each segment becomes large enough to fit the largest item.\n")
B.Gm=new A.a1(57423,"MaterialIcons",!1)
B.baz=new A.d9("FloatingActionButton and Chip",B.Gm,0,"FAB and\nChip",'The FloatingActionButton, the "FAB", represents the most important action on a screen. It puts key actions within reach. In M2 design it uses secondary color by default. In M3 color system secondary color is by default a very muted color, in M3 mode it instead maps to primaryContainer color. If you use an M3 seed generated ColorScheme in M2 mode, it is recommended to use another themed color for the FAB than secondary color.\n\nChips help people enter information, make selections, filter content, or trigger actions. It has a totally new design in M3 mode, FCS M2 mode takes some inspiration from it, while also retaining some M2 style influences.\n')
B.aEA=new A.a1(61065,"MaterialIcons",!1)
B.bat=new A.d9("Menus",B.aEA,0,"Menus","Menus display a list of choices on a temporary surface.\n\nThe PopupMenuButton is a Material 2 menu control, it still works well, but prefer using the new more versatile M3 menu components, like MenuAnchor, DropdownMenu and MenuBar.\n")
B.aF5=new A.a1(61806,"MaterialIcons",!0)
B.bae=new A.d9("Tooltip, Icon, CircleAvatar and DropdownButton ",B.aF5,0,"Tooltip, Icon\nAvatar, Drop","Tooltips display informative text when users hover over, focus on, or tap an element.\n")
B.aFu=new A.a1(62543,"MaterialIcons",!1)
B.bar=new A.d9("Switch, CheckBox and Radio",B.aFu,0,"Switch\nCheck Radio","Switches toggle the state of a single item on or off.\n\nCheckboxes allow users to select one or more items from a set. Checkboxes can turn an option on or off.\n\nRadio buttons allow users to select one option from a set.\n")
B.aEp=new A.a1(59011,"MaterialIcons",!1)
B.baI=new A.d9("Slider",B.aEp,0,"Slider","Sliders allow users to make selections from a range of values.\n\nSlider and its theme are very configurable in Flutter. Slider has classes designed to be extended for complete customization capabilities. FCS and Playground offer a good starter set. Use copyWith on FCS generated theme if you need further customization of the Slider or extend its classes.\n")
