B.aEI=new A.a1(61213,"MaterialIcons",!1)
B.bai=new A.d9("BottomSheet, SnackBar and MaterialBanner",B.aEI,0,"BottomSheet\nSnack Banner","Bottom sheets are surfaces containing supplementary content, anchored to the bottom of the screen.\n\nA SnackBar is used to provide brief messages about app processes at the bottom of the screen.\n\nBanners are similar, but at the top of the screen and often used to provide more information on topics related to content in the application.\n")
