B.aEV=new A.a1(61590,"MaterialIcons",!1)
B.baD=new A.d9("TextTheme",B.aEV,0,"Text\nTheme","The default typeface for Android is Roboto. Flutter uses platform specific default typefaces. The Typography (2021)  introduced with Material 3 is better than past Material 2 typography (2018 in Flutter) or even older (2014), the default on used in Flutter when using M2, even if 2018 is the correct M2 typography. Recommend using the nicer M3 Typography in both M2 and M3 mode.\n\nMaterial's default type scale includes contrasting and flexible styles to support a wide range of use cases. You can modify the global styles. However, Flutter widgets expect certain font sizes and depend on the global TextTheme for their default styles. Changing a style in the global TextTheme will impact default styles for all components that use the style. To avoid this, prefer defining custom text styles for each component theme.\n\nFor custom content related TextStyles, prefer defining separate content text styles and considering adding them as theme extensions.\n")
B.aDX=new A.a1(58024,"MaterialIcons",!1)
B.baH=new A.d9("PrimaryTextTheme",B.aDX,0,"Primary\nTextTheme","The primary text theme sounds based on its name like it should be a TextTheme that by default fits on primary colored surfaces. It actually does so in light theme mode, but not always in Flutter by default in dark theme mode. FlexColorScheme corrects this and makes it always work in dark mode as well.\n")
B.Gs=new A.a1(58016,"MaterialIcons",!1)
B.ban=new A.d9("Widget showcase",B.Gs,0,"Widget\nshowcase","This page presents most Flutter Material UI widgets, in one large page, as they look when the current theme is applied on them.\n")
