B.aFH=new A.a1(984432,"MaterialIcons",!1)
B.baJ=new A.d9("Material",B.aFH,0,"Material","Material widget is a lower level building block. It cannot be themed, but it has Material 2 and Material 3 mode dependent behavior. Material is responsible for clipping, elevation and ink effects below its children.\n")
