B.bay=new A.d9("Android system navigation bar",B.aEy,0,"Android\nSystem Nav",'The system navigation bar in Android is in newer versions the swipe bar at the bottom of the screen used for swipe gestures. In older versions it is made up of the 3 system navigation buttons. The system navigation area can be styled in Flutter, but not via themes.\n\nThe AnnotatedRegion widget can be used to style it. FlexColorScheme contains a helper called "FlexColorScheme.themedSystemNavigationBar" to make it easy to style with a selected style that fits with a theme made by FlexColorColorScheme.\n')
